def solution(stdin: str) -> str:

    strings = stdin.split()

    # Find the longest string
    longest = max(strings, key=len)

    for i, string in enumerate(strings):
        # if string is not in the longest string and is not a substring of the other strings
        # then it can be reordered
        if string not in longest and string not in [string[:len(string)] for string in strings[:i] + strings[i + 1:]]:
            return "NO"
        # if the string is a substring of the longest string then all the other strings are in the order
        # so string is reordered
        elif string in longest:
            for j in range(i + 1, len(strings)):
                if strings[j] not in longest:
                    return "NO"
                elif strings[j] in longest and strings[j] not in [strings[j][:len(strings[j])] for strings in strings[i + 1:]]:
                    return "NO"
            return "YES"


